"use strict";$(function(){$("[data-help-for]").each(function(){var n=$(this),t="#"+n.attr("data-help-for");$(t).focus(function(){$("[data-help-for]").hide();n.show()})});$("[data-colorbox-for]").each(function(){var t=$(this),n="#"+t.attr("data-colorbox-for");$(n).change(function(){t.css("background-color",$(n).val())});$(n).change()})});